import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import './Home.css';



class Home extends React.Component {
  render() {
    return (
      <div className="cComponent" >
        <img src="/banner.jpg" /><h1 align="center">Some header example</h1>
      </div>
    );
  }
}

export default Home;
